import React from 'react'

const Footer = () => {
    return (
        <div>
            MyDailyStatus is a project created during the Fullstack Lab by DevPleno.
            Implemented by: <a href="https://www.linkedin.com/in/pedroafonsoferraz/">Pedro Afonso</a>
        </div>
    )
}

export default Footer
